<!DOCTYPE html>
<html lang="en">
<head>

  <title>Tic Tac Toe</title>

  <script type="text/javascript" src="script.js"></script>
  <link rel="stylesheet" href="main.css">
</head>
<body>
  <h1>TIC TAC TOE</h1>

      <div id="dummy"></div>
      <table id="element">
        <tbody>
          <tr>
            <td id="one"></td>
            <td id="two"></td>
            <td id="three"></td>
          </tr>
          <tr>
            <td id="four"></td>
            <td id="five"></td>
            <td id="six"></td>
          </tr>
          <tr>
            <td id="seven"></td>
            <td id="eight"></td>
            <td id="nine"></td>
          </tr>
        </tbody>
      </table>
    </div>
</body>
</html>
